$(window).load(function() {
    var output = {};
var words = []
var sentences = [];
var wordcolors = [];
var colors = ["#5e65db", "#a448d9", "#d94871", "#d97148", "#cad948", "#48d973"];

// var imgs = [];
$.getJSON( "./wordlist.json", function( data ) {

    $.each(data, function(key, val) {
        // output.push({
        //     word: key,
        //     sentences: val,
        //     color: colors[(Math.floor(Math.random() * 6) + 1)-1]
        // })
        words.push(key);
        sentences.push(val);
        wordcolors.push(colors[(Math.floor(Math.random() * colors.length) + 1)-1]);
        
       
      });
     })
  .done(function(){
    copyToClipboard(sentences);
    console.log("issa done");
    loadWord(words, sentences, wordcolors);
  });

  $("#next").click(function(){
    pointer+=1;
    $("#sentences").html("");
    if(pointer>=doneWords.length)
    loadWord(words, sentences, wordcolors);
    else{
      var item = words.indexOf(doneWords[pointer]);
      $("#wordName").text(words[item]);
      var i = 0;
      sentences[item].forEach(e => {
        $("#sentences").append('<li>'+e+" ("+sentenceengs[item][i]+')</li>');
        console.log(sentenceengs[item][i])
        i++;
      });
      $("#container").css('background-color', wordcolors[item]);
      $("#sample").attr("src",imgs[item]);
      $("#meaning").text(wordengs[item]);
    }
  });

  $("#back").click(function(){
    if(pointer>0){
      $("#sentences").html("");
      pointer--;
      var item = words.indexOf(doneWords[pointer]);
      $("#wordName").text(words[item]);
      var i=0;
      sentences[item].forEach(e => {
        sentenceengs[item][i]
          $("#sentences").append('<li>'+e+" ("+sentenceengs[item][i]+')</li>');
          i++;
      });
      $("#container").css('background-color', wordcolors[item]);
      $("#sample").attr("src",imgs[item]);
      $("#meaning").text(wordengs[item]);
    }
  });
    
});

var loadWord = function(words, sentences, wordcolors){
    // console.log(imgs);
    
    var ran = (Math.floor(Math.random() * words.length) + 1)-1;

    var newword = words[ran];
    var s,c;
    // for(var i=0; i<627; i++){
    //     console.log(output[i]);
    //     if(output[i].word == newword){
    //         sentences = output[i].sentences;
    //         color = output[i].color;
    //         break;
    //     }
    // }
    s = sentences[ran];
    c = wordcolors[ran];
    i = imgs[ran];
    doneWords.push(newword);
    $("#wordName").text(newword);
    var j=0;
    s.forEach(e => {
      $("#sentences").append('<li>'+e+" ("+sentenceengs[ran][j]+')</li>');
      j++;
    });
    $("#container").css('background-color', c);
    $("#sample").attr("src",i);
    $("#meaning").text(wordengs[ran]);
}

function copyToClipboard(text) {
  var dummy = document.createElement("textarea");
  // to avoid breaking orgain page when copying more words
  // cant copy when adding below this code
  // dummy.style.display = 'none'
  document.body.appendChild(dummy);
  //Be careful if you use texarea. setAttribute('value', value), which works with "input" does not work with "textarea".  Eduard
  dummy.value = text;
  dummy.select();
  document.execCommand("copy");
  document.body.removeChild(dummy);
}

